import { BrowserRouter, Routes, Route } from 'react-router-dom'

// page components
import Home from './pages/home/Home'
import Navbar from './components/Navbar'

import './App.css'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} /> 
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
